} from "@marigold-dev/tezos-community-reactcontext";
import { address } from "../type-aliases";
import { getUserProfile } from "@marigold-dev/tezos-community"; Import the React context const { setUserProfile, connectToWeb2Backend, localStorage, setUserProfiles, userProfiles,
} = React.useContext(TzCommunityReactContext) as TzCommunityReactContextType; Connect to TzCommunity backend just after your logged with your wallet on Beacon. You can use setUserProfile to set your profile to a global context like below const connectWallet = async (): Promise<void> => { ... try { await wallet.requestPermissions({ network: { type: NetworkType[ import.meta.env.VITE_NETWORK.toUpperCase() as keyof typeof NetworkType ], rpcUrl: import.meta.env.VITE_TEZOS_NODE, }, }); // gets user's address const userAddress = await wallet.getPKH(); await setup(userAddress); //connect to TzCommunity await connectToWeb2Backend( wallet, userAddress, ( await wallet.client.getActiveAccount() )?.publicKey!, localStorage ); //try to load your user profile try { const newUserProfile = await getUserProfile(userAddress, localStorage); setUserProfile(newUserProfile!); setUserProfiles( userProfiles.set(userAddress as address, newUserProfile!) ); } catch (error) { console.warn( "User " + userAddress + " has no social account profile link on TzCommunity" ); } Disconnect On your disconnect function, remove SIWT tokens from local storage const disconnectWallet = async (): Promise<void> => { //TzCommunity if (localStorage.initialized) { console.log("localStorage is initialized, removing access tokens"); await localStorage.remove(LocalStorageKeys.access_token); //remove SIWT tokens await localStorage.remove(LocalStorageKeys.id_token); //remove SIWT tokens await localStorage.remove(LocalStorageKeys.refresh_token); //remove SIWT tokens } else { console.warn("localStorage not initialized, cannot remove access tokens"); } //End TzCommunity

